(1, 1, '', '', '2016-10-02 10:44:16', '<p><span style="font-size: 18px;"><span style="color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 20.8px; background-color: rgb(255, 255, 255);">&nbsp; &nbsp; &nbsp;加州俱樂部是壹個順應曆史潮流，在全球實體經濟壹片低迷的情況下，由地球幣EAC玩家們發起的、全球性的慈善互助組織。該組織本著誠信、公平、互助的原則，爲虛擬貨幣玩家們提供壹個非贏利的互助平臺。在世界金融體系混亂，立誌建立壹個慈善互助的完美的金融協助體系，把壹套數學模型，設計成壹套循環經濟模式的系統，循環經濟模式在國外已經運行了四年，證實可行的金融模式。此模式不需要公司爲載體，資金完全在會員中流通。加州俱樂部的循環經濟利率相對高，所以存錢的永遠比取錢的人數多，生命力極其頑強。</span><br style="box-sizing: border-box; color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 13px; line-height: 20.8px; white-space: normal; background-color: rgb(255, 255, 255);"/><span style="color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 20.8px; background-color: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;</span><br style="box-sizing: border-box; color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 13px; line-height: 20.8px; white-space: normal; background-color: rgb(255, 255, 255);"/><span style="color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 20.8px; background-color: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 虛擬貨幣是未來金融系統的主導幣種,地球幣正是順應未來的潮流,抓住先機,加州慈善俱樂部給所有的會員們創造壹個真正的以小博大的機會。</span><br style="box-sizing: border-box; color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 13px; line-height: 20.8px; white-space: normal; background-color: rgb(255, 255, 255);"/><span style="color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 20.8px; background-color: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 加州俱樂部不是銀行，不收您的錢，不是網上業務，也不是高投資或傳銷計劃。是壹個互相幫助的社區。給您壹個技術基本計劃，</span><br style="box-sizing: border-box; color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 13px; line-height: 20.8px; white-space: normal; background-color: rgb(255, 255, 255);"/><span style="color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 20.8px; background-color: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 加州俱樂部是提供彼此互相幫助的人們的社區，無償援助，互惠和仁愛作爲。</span><br style="box-sizing: border-box; color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 13px; line-height: 20.8px; white-space: normal; background-color: rgb(255, 255, 255);"/><span style="color: rgb(106, 108, 111); font-family: &#39;Open Sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; line-height: 20.8px; background-color: rgb(255, 255, 255);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在加州俱樂部您不必訂立合同或承諾您的財産。沒有貸款，沒有欠債。壹切都非常簡單：壹位參與者要求幫助，另壹位提供幫助。唯壹的事情要求從參與者就是要彼此誠實和善良。</span></span></p>', '加州慈善俱樂部介紹', '', 3, 1, '2016-10-10 14:54:53', '', 0, 1, '', 0, '{"thumb":"portal\\/20161003\\/57f1c95cda583.jpg"}', 0, 0, 0, 0),
(3, 1, '', NULL, '2016-10-22 01:37:17', '<p><span style="font-size: 16px;"></span></p><p><span style="font-size: 20px;"></span></p><p>親愛的加州會員，由於平臺這次大清查整治工作中發現了很多投機取巧的會員，上面會員以小額打款來獲取下線會員高額打款的推薦獎金及管理獎金，這就是欺詐行為。為了能讓我們平臺能夠健康長久的運行，平臺決定設置獎金燒傷制度。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 獎金燒傷制度就是如果上線會員打款1000，下線會員打款20000，那上線會員只能獲得下線會員打款額中的自己打款額1000的8%推薦獎金與後面的管理獎金。所以，請各位家人們合理安排好自己提供幫助的打款額度！</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 特此通告！</p><p><span style="font-size: 20px;"></span></p>', '管理奖与推荐奖', NULL, 3, 1, '2016-10-22 01:48:34', NULL, 0, 1, '', 0, '{"thumb":""}', 0, 0, 0, 0),
