(5, 1, '', NULL, '2017-03-16 15:34:27', '<p><strong>果园介绍：</strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>1、种地</strong>：鼠标点击种地，鼠标变成铲子形状，点击要种树的地块上，只要金桔数量够就种地成功（金地3000枚金桔，普通地300个金桔），否则种地失败。&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="./instruction_files/shuoming1.png"/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>2、增种</strong>：选择增种工具，点击已经开垦过的土地上，弹出增加播种框，输入需要增加播种的金桔数量，点击“确定”，这块地上完成增种。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>3、浇水</strong>：每天登录农场，果树的状态发生变化，需要浇水才能恢复生机，否则隔天会掉落少量果实。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="./instruction_files/shuoming2.png"/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>4、施肥：</strong>选择施肥按钮，点击您要施肥的地块，出现施肥效果，随即该地块的金桔数量增加，仓库里面的化肥就为空（如果您施肥的地块到达最大数量上限而化肥没有用完，可以再次到其他地块施肥，直到化肥施完）。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>化肥是怎么来的？</strong>系统会根据您地里边今日种植的金桔数量产生相应数量的化肥（仓库的金桔不会产生化肥，所以请及时种到地里），并于次日自动放到您的仓库里。另外，每日赠送的化肥只能当日使用。<br/><br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>5、收获：</strong>点击收获按钮，移到要收获的地块，该地块的金桔数量除了最低播种限度外的其他金桔都会收回到您的仓库里，完成收获。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>6、刷新：</strong>刷新游戏，检查最新状态<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>7、采蜜：</strong>如果好友果园产生化肥，您也随即产生相应的蜜蜂（会员化肥*固定系数），蜜蜂仅限当日使用，不会累计到次日。当好友施肥后，你可以对其进行采蜜，进入好友果园，选择采蜜，点击可以采蜜的果树，蜜蜂会飞出去采蜜，您的仓库会得到相应的金桔数量。如果好友数量多，您可以订购一键采蜜功能，无需进入好友果园，便可直接对所有好友采蜜。如下图：<br/><br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="./instruction_files/shuoming3.png"/><br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="./instruction_files/shuoming7.png"/><br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>8、稻草人：</strong>每推荐10个会员系统会奖励1个稻草人，上限是4个，稻草人可以插入到稻草人占位坑中（如下图）。稻草人可以使您的金桔不被动物偷吃（插入坑位中才能生效），如果没有稻草人系统每天会从您的金桔生长中扣除一定的比例，（4-稻草人数量）*\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;系数 。<br/><br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;推荐会员包括后台和开发新果园<br/><br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="./instruction_files/shuoming6.png"/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="./instruction_files/shuoming4.png"/><br/><br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>10、金地：</strong>金地开地需要3000个金桔，增种的上限是30000<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>11、普通地：</strong>普通地开地需要300个金桔，增种的上限是3000<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;（注意：地块达到最高数量无法再增加播种和施肥，此时您要采摘出售您的果实，地块一旦种植后，都要保留最低限度的金桔数量（普通地300,金地3000），最低数量时无法采摘。所有土地全部开垦，定向出售时可以免手续费。）<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>12、哈士奇：</strong>化肥累计达到50000后，赠送一条哈士奇，可以提高生长比例。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>13、藏獒：</strong>化肥累计达到150000后，赠送一条藏獒，可以提高生长比例。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="./instruction_files/shuoming5.png"/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>14、果树：</strong>如下图，果树上的金桔数量不同，生长状态也不一样，一共有8种状态，普通土地里数量为300（金土地3000）时为一种状态，当数量超过3000/8个（金土地达到30000/8个）时进入下一个状态，之后每增加3000/8个金桔（金土地每增加30000/8个）时，果树状态变化一次。另外：当果树出现干涸状态，浇水即可，前面（3.浇水）已经说明。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="./instruction_files/shuoming8.png"/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>15、开发新果园：</strong>开发新果园会从您的粮仓扣除330个金桔装备，系统扣除30个金桔，新果园得到300个金桔。另外，开发新果园的同时，可以得到16个种子奖励，种子在交易中心处可转换为等量金桔。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>16、游戏玩家等级说明：</strong>级别有贫农、中农、中上农、富农、农场主、庄园主、地产主，玩家开一块普通地积1分，开一块金土地积10分，每累计10分可升一级（共7级），每升一个级别可以额外享受生长速度奖励（贫农除外）。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>17、果园生长记录查看：</strong>可查看的记录包括农场生长记录、种子奖励记录、狗奖励记录、采蜜记录、播种记录、收割记录、装备奖励记录。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>18、交易中心：</strong>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1）订购交易验证码：需要100个金桔的费用，订购成功之后，每次交易金桔，都需要输入验证码。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2）出售金桔：金桔可以自由交易，从农场采摘到仓库后，你可以申请出售金桔，包括委托出售和定向出售。其中委托出售是由系统匹配买家，定向出售需要填写目标会员账号和姓名。确认出售后会从仓库扣除金桔数量。出售过程中需要买家在购买记录确认支付，再由卖家确认收米，完成整个交易操作后，买家仓库才会多出金桔数量。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3）种子兑换：获得种子奖励包括开发新果园和推荐好友（后台添加），每增加一个好友，获得16个种子奖励，100个种子可以兑换90个金桔。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>19、个人信息：</strong>在个人信息可修改密码和个人资料。<br/><br/></p>', '财富庄园操作指南', NULL, 3, 1, '2017-03-16 15:35:14', NULL, 0, 1, '', 0, '{"thumb":""}', 0, 0, 0, 0),
